        id: 420201816349588,
        name: 'BREATHE: Respiratory Health',
        description:
            'BREATHE facilitates the safe and responsible use of respiratory health data at scale, sparking research and innovation for the benefit of UK patients.  \n\nBREATHE is a collaboration between patients and publics, UK Universities, third sector, Government organisations and industry from across the UK and globally. The Hub is led by The University of Edinburgh, Imperial College London, University of Leicester, Nottingham University Hospitals NHS Trust, Queen Mary University of London and Swansea University.\n\nAt BREATHE, we want to improve respiratory health by changing the way the NHS, researchers, industry and charities use data. We are doing this by:\n\nâ€¢\tBringing together useful respiratory datasets, so they can be easily discovered by researchers and innovators.\n\nâ€¢\tCurating and improving these datasets, providing access to the highest quality data.\n\nâ€¢\tProviding services and expertise to drive the use of health data in ground-breaking research and innovation.\n\nâ€¢\tWorking in partnership with patients and the public to promote the responsible use of health data for patient benefit, protecting privacy at all stages.\n\nWebsite link: https://www.ed.ac.uk/usher/breathe',
