        name: 'Alleviate',
        description:
            'Chronic pain is a major unmet global public health challenge. It affects around 1 in 5 people, and causes more disability than any other condition, anywhere in the world.\n\nAlleviate is the APDP (Advanced Pain Discovery Platform) Pain Research Data Hub, and aims to transform UK pain datasets to be Findable, Accessible, Interoperable and Reusable (FAIR). \n\nThe Hub is led by the University of Dundee, University of Nottingham, Kingâ€™s College London, Imperial College London, University of Oxford, University of Bath, and Cambridge Institute for Medical Research.\n\nFor full details, see the following URL: https://www.hdruk.ac.uk/helping-with-health-data/our-hubs-across-the-uk/alleviate/',
