        name: 'INSIGHT: Eye Health',
        description:
            "INSIGHT is a first-of-its-kind linkage of routinely collected, anonymised high-dimensional eye-imaging data from the major ocular diseases impacting blindness to 'Oculomics'.  This long term prospective database of ocular data, including patient centred data, ophthalmic imaging and electrodiagnostics, visual fields and other clinical data captured in geographical format.  We aim to support research and innovation into eye health and systemic health where this can be informed by eye imaging.\n\nWebsite: https://www.insight.hdrhub.org/",
