        id: 9395697949340248,
        name: 'HSC Northern Ireland Honest Broker Service TRE',
        description:
            "The Honest Broker Service is the Trusted Research Environment for Health and Social Care Northern Ireland and is hosted\nwithin the HSC Regional Business Services Organisation (BSO). \nThe HBS provides approved researchers with access to linked, de-identified health data via a safe setting. \nData is either accessed via attendance at the Safe Haven in BSOâ€™s headquarters in Belfast or remotely via the UK Secure e-Research Platform (UK SeRP).\nThe service provides secure project areas where researchers can collaborate, link data, share code and results within their same approved research project. Researchers attending the safe haven or accessing data remotely via the HDRNI UK SeRP have access to a range of analytical tools. \n\nThe Honest Broker Service does not provide identifiable data for consented studies or trials.\n\nActive Users: 25 | Active Projects: 30\n\nPricing: Daily charge Â£475+VAT which covers data preparation and access\n\n---\n\n### SAFE People - Login & Access  \n\nâ€¢ All users must provide a CV: Evidence of research career via CV, belong to recognised Institution and completed Safe Researcher  training.  \n\nâœ“ Login:  Physical Setting: User account provisioned and maintained by HSC IT /  HDRNI SeRP:  Self-registration, login to Virtual Desktop Infrastructure (VDI) via SSO and 2FA\n\nâœ“ Minimum Requirement: No minimum requirement\n\nâœ“ International Access: International access allowed\n\n---\n\n### SAFE Settings - Compute & Services\n\nPhysical Setting:\n\nâœ— On-Premise Environment\n\nâœ“ Standard Desktop Workstation Minimum Core Dell Optiplex 3060  \n\nâœ— No Ability to modify OS\n\nâœ— No Managed Data analytics capabilities\n\nâœ— No federated queries\n\nâœ— No federated analytics\n\nHDRNI SeRP:\n\nâœ“ Hybrid Cloud Environment\n\nâœ“ Windows 7 (extended support), Windows 10, Server 2019, Debian and Ubuntu\n\nâœ“ Options for Windows 10 VDI - 4C/16GB â€“ 8C/32GB â€“ 16C/128GB -128C/1.5TB (Limited), SSD/Flash Array, Linux VDI, Linux Clusters â€“ Bespoke or K8S, SLURM, SPARK, Jupyter GPU are available in Jupyter and SLURMHPC through SLURM Virtualisation through VMware or Openstack Storage through IBM all flash SAN's, Dell traditional SAN's to Redhat CEPH 1.6PB 3 Tiered storage - block, ISCSI, object Database provide IBM DB2 cluster, MS SQL Server Cluster, Postgres, Elastic search, SPARK SQL, Redis, MYSQL\n\nâœ“ Ability to modify OS on request depending on governance.\n\nâœ“ Managed Data analytics capabilities: K8s, Airflow, Spark, SLURM, Jupyter\n\nâœ— No federated queries (WIP â€“ PoC developed as part of previous projects)\n\nâœ— No federated analytics (WIP â€“ Pock developed as part of previous projects)\n\n---\n\n### SAFE Settings - Security Certifications and Measures\n\nPhysical Setting:\n\nâœ“ Security Certifications: Formed as part BSO. ISO 27001 is a target. BSO is registered with ICO â€“ Z1715830 and processes personal data according to its Privacy policy\n\nâœ“ Security Measures: Physical presence needed and supervised at all times\n\nâœ“ No VM direct access  \n\nâœ“ No VM access control (no USB, copy/paste, internet access whitelisted or internal mirrors)  \n\nHDRNI SeRP:\n\nâœ“ Security Certifications: ISO 27001, NHS Toolkit, DEA Accreditations\n\nâœ“ Security Measures: Everything needed to gain ISO, 2FA, multi vender firewalls, DES. Account lock, SEIM (logging), Audit, Review Process, Monitoring etc\n\nâœ“ No VM direct access, Access only through VDI only\n\nâœ“ No VM access control (no USB, copy/paste, internet access whitelisted or internal mirrors)\n\n---\n\n### SAFE Settings - Software access  \nPhysical Setting:\n\nâœ“ Default software: Excel, SPSS, STATA and R  \n\nâœ“ Code/library import: Code can be imported by email to HBS staff  \n\nâœ— No Collaboration Software\n\nHDRNI SeRP:\n\nâœ“ Default software: Office, R, Python, Conda, SPSS, STATA, SAS, Jupter Notebook, eclipse, VS Code, DB tooling\n\nâœ“ Code/library import: Whitelisted package libraries for R, Python Conda, SAS, STATA, SPSS. Extra packages can be added by technical team on request. AV/Malware, SEIM and N/W monitoring\n\nâœ“ Collaboration Software: Git, Wiki, Confluence, Shared File Store, Shared DB\n\n---\n\n### SAFE Data - Data Access Mechanisms\n\nâœ“ Data Provisioning: Scoped and minimized dataset provisioned  \n\nâœ“ Receive Data: Ability to receive data on a project by project basis \n\n- Linked Data: âœ“ With appropriate Data Access Agreements transfer via encrypted pen drive  \n\n- Sensitive Data: âœ“ Some datasets with sensitive data are held centrally in an un-linkable manner  \n\n- Open Data: âœ“ Email or file exchange and HBS staff transfer to HSCNI network available\n\nâœ“ Record Linkage: Linkage done via - Health and care number, Name, DOB, Postcode\n\nâœ“ Reduce re-identification risk by: pseudonymization, minimizing dataset, encryption and encryption of linkage keys, small number output suppression\n\n---\n\n### SAFE Outputs - Data Output/export  \n\nâœ“ Aggregate level graphs and tables. Source code developed within the environment\n\nâœ— Export plans: No\n\nâœ“ Data transmit to other SAFE Settings: Partnership with ADRNI and NILS \n\nâœ“ Statistical disclosure control process in place",
