        id: 3975719127757711,
        name: 'Cardiovascular disease (CVD)-COVID-UK / COVID-IMPACT',
        description:
            'CVD-COVID-UK, co-ordinated by the British Heart Foundation (BHF) Data Science Centre, is one of the NIHR-BHF Cardiovascular Partnershipâ€™s National Flagship Projects.\n\nIt aims to understand the relationship between COVID-19 and cardiovascular diseases such as heart attack, heart failure, stroke, and blood clots in the lungs through analyses of de-identified, pseudonymised, linked, nationally collated health datasets across the four nations of the UK.\n\nThe consortium has over 200 members across more than 40 institutions including data custodians, data scientists with methodological and analytical expertise and clinicians, all of whom have signed up to an agreed set of principles with an inclusive, open and transparent ethos.\n\nApproved researchers access data within secure trusted research environments (TREs) provided by NHS Digital in England, the National Data Safe Haven in Scotland, the SAIL Databank in Wales and the Honest Broker Service in Northern Ireland.\n\nLinked datasets include those from primary and secondary care, COVID lab tests and vaccinations, deaths, critical care, prescribing/dispensing, cardiovascular and stroke audits, maternity services and mental health.\n\nBuilding on the success of CVD-COVID-UK, the BHF Data Science Centre has now gained ethical and regulatory approval to broaden the scope of the programme to all COVID-related research (in NHS Digitalâ€™s TRE for England only).  This is known as COVID-IMPACT and it will help to support research projects from the wider community, including for National Core Studies.\n\nMore detail about CVD-COVID-UK / COVID-IMPACT, including a dashboard of datasets currently available in each nationâ€™s TRE, can be found at: https://www.hdruk.ac.uk/projects/cvd-covid-uk-project/ ',
