        id: 5493969548153421,
        name: 'ONS Secure Research Service',
        description:
            'The Secure Research Service (SRS) operates within the Five Safes Framework, which is a set of principles that safeguard access to the sensitive data that are available for use by appropriately trained and accredited members of the research community. SRS is an accredited data processor under the Digital Economy Act 2017 (the Act). What this means is that the SRS does not own the data that is made available through the service and data owners are separately identified in the Act. Whenever the SRS acquires data that is to be made available to the research community, an agreement is signed with the data owners that specifies the conditions under which data can be accessed and any restrictions that may be placed on individual datasets. As part of this process, data owners typically wish to know information about how Five Safes will apply to their dataset.\n\nActive Users: 2000 | Active Projects: 900\n\nPricing: Centrally funded - no charge at the point of access.\n\n---\n\n### SAFE People - Login & Access  \n\nâ€¢ Accredited Researcher Status Required - Training, Public record, Sign Declaration, Research project Accreditation\n\nâœ“ Login: Citrix workspaces â€“ encrypted tunnels and unique account logon\n\nâœ— Minimum Requirement: [Assured Organizational Connectivity](https://www.ons.gov.uk/aboutus/whatwedo/statistics/requestingstatistics/approvedresearcherscheme#assured-organisational-connectivity-to-the-secure-research-service) or willingness to travel to ONS offices.\n\nâœ— International Access: Not in general. Exceptions may be possible.\n\n---\n\n### SAFE Settings - Compute & Services\n\nâœ“ Private Cloud\n\nâœ“ 6 Citrix servers in farm provide computing power. 96GB mem 32 cores per server. Additional SQL servers are also available for the manipulation of relational data.\n\nâœ— No ability to modify OS\n\nâœ— Managed Data analytics capabilities: None provided\n\nâœ— No federated queries\n\nâœ— No federated analytics\n\n---\n\n### SAFE Settings - Security Certifications and Measures\n\nâœ“ Security Certifications: ISO27001 and DEA Accredited\n\nâœ“ Security Measures: Dedicated Security Team. ObserveIT monitors all screen and keyboard activity. Splunk used to monitor events captured to GPG 13 DTER standard\n\nâœ“ No VM direct access  \n\nâœ“ No VM access control (no USB, copy/paste, internet access whitelisted or internal mirrors)  \n\n---\n\n### SAFE Settings - Software access  \n\nâœ“ Default software: Office, SAS, SPSS, STATA, R, Python\n\nâœ“ Code/library import: Governance process where 2 people check code\n\nâœ— Collaboration Software: No\n\n---\n\n### SAFE Data - Data Access Mechanisms\n\nâœ“ Data Provisioning: Minimized read-only links within project spaces to research-ready datasets\n\nâœ“ Reduce re-identification risk by: SRS output checking procedures available on request. No internet access\n\nâœ“ Receive Data: Via Transfer Services - MoveIT and ONS AWS S3 Storage\n\n- âœ“ Linked Data: Manual Linkage via transfer services\n\n- âœ“ Sensitive Data: Ingest procedures exist which are checked by ONS staff\n\n- âœ“ Open Data: Via Transfer Services - MoveIT and ONS AWS S3 Storage\n\nâœ“ Record Linkage: Not as service, but this can be carried out by ONS staff prior to ingestion\n\n---\n\n### SAFE Outputs - Data Output/export  \n\nâœ“ Aggregate level graphs and tables. Aggregate level graphs and tables, individual level, anonymized data, Weights and code for a trained AI algorithm, Source code developed with the environment\n\nâœ“ Export plans: None Specified\n\nâœ“ Data transmit to other SAFE Settings: Via Transfer Services\n\nâœ“ Statistical disclosure control process in place',
