        id: 9118411587595364,
        name: 'NHS Digital TRE',
        description:
            'NHS Digitalâ€™s Trusted Research Environment (TRE) service for England provides approved researchers with access to essential linked, de-identified health data to quickly answer COVID-19 related research questions. The TRE service provides researchers with support on data access requests, provision of data using our secure data platform the Data Processing Service (DPS) and help with analysis work. Approved research projects will help to guide national decision making and recommend potential interventions to reduce the severity of COVID-19 outcomes.\n\nWe are delivering the TRE service in partnership with Health Data Research UK (HDR UK).  Our shared objective is to provide rapid, safe and trustworthy access to data in a transparent way that accelerates the pace of quality research, playing a leading role in the UKâ€™s COVID-19 response.\n\nActive Users: 650 | Active Projects: 1 Large Consortium\n\nPricing: Yes. A charging model is in development and is currently being refined working in partnership with the serviceâ€™s first customers.\n\n---\n\n### SAFE People - Login & Access  \n\nâ€¢ Organisation accreditation via DSPT. Data Sharing Agreement. End User Access Agreement\n\nâœ“ Login: Browser based login using 2FA\n\nâœ“ Minimum Requirement: [System Requrirements](https://digital.nhs.uk/services/data-access-environment-dae/user-guides/set-up-guide)\n\nâœ“ International Access: At a technology-level yes. There are data sharing agreement restrictions on the use of (some) data\n\n---\n\n### SAFE Settings - Compute & Services\n\nâœ“ Public Cloud\n\nâœ“ The TRE is hosted on a public cloud, so there are no physical hardware constraints.  Compute power isnâ€™t directly allocated per user; compute and memory capacity is managed across the service.\n\nâœ“ All current offerings are web-based tools (offered within the secure boundary of the environment).\n\nâœ“ Ability to modify OS\n\nâœ“ Managed Data analytics capabilities: Databricks\n\nâœ“ Federated queries\n\nâœ“ Federated analytics\n\n---\n\n### SAFE Settings - Security Certifications and Measures\n\nâœ“ Security Certifications: AWS complied NHS Cloud Security Guidance.\n\nâœ“ Security Measures: Penetration Testing carried out periodically. AWS monitored by Engineers and Care Security Operations Centre. User actions performed in VM with SSO 2FA. Activity logging, Cut/Paste disabled\n\nâœ“ No VM direct access  \n\nâœ“ No VM access control (no USB, copy/paste, internet access whitelisted or internal mirrors)  \n\n---\n\n### SAFE Settings - Software access  \n\nâœ“ Default software: Databricks (which includes Python and SQL), R-Studio, Tableau and Stata are also pipelined for provision, alongside a number of desktop tools.\n\nâœ“ Code/library import: Code can be imported by Service Request. User permitted to paste small amounts of code into TRE\n\nâœ“ Collaboration Software: BETA Gitlab\n\n---\n\n### SAFE Data - Data Access Mechanisms\n\nâœ“ Data Provisioning: Scoped and minimized dataset provisioned on a per project basis\n\nâœ“ Reduce re-identification risk by: Deidentification via Privitar\n\nâœ“ Receive Data: Standard process exists\n\n- âœ“ Linked Data: Standard process exists\n\n- âœ“ Sensitive Data: Standard process exists\n\n- âœ“ Open Data: Standard process exists\n\nâœ“ Record Linkage: Linkage performed via Master Person Service\n\n---\n\n### SAFE Outputs - Data Output/export  \n\nâœ“ The TRE service allows research (aggregate) results to be safely exported.  This is via an escrow function manned by NHS Digital employees who examine the artefacts prior to release to the user â€“   based upon an approved, principles-based disclosure control output policy. Patient / row level data cannot be exported.\n\nâœ“ Export plans: NHSD are currently exploring a range of safe data outputs types and welcome the opportunity of brining NCS projects into this exploration. We anticipate being able to allow userâ€™s code to be exported in the future.\n\nâœ“ Data transmit to other SAFE Settings: We do not provide this service at present.  However, ad-hoc requests can be considered via a Service Request\n\nâœ“ Statistical disclosure control process in place',
