        name: 'Cohort Discovery ',
        description:
            'Cohort Discovery is a new Gateway feature that will allow users to carry out a more specific search and assessment on datasets, to improve discovery. \n\nUsing the tool users can search across multiple datasets to find cohorts (groups) of patients with specific, defined characteristics (e.g patients that donâ€™t smoke aged between 18-30 and who live in England).\n\nThis collection shows you the datasets that are currently onboarded into the Cohort Discovery Tool. We will be adding more into the tool over the coming months.\n\nFind out how to access the Cohort Discovery Tool [here.](https://www.healthdatagateway.org/about/cohort-discovery)',
