        id: 7189037514031495,
        name: 'HDR UK Multi-omics Consortium ',
        description:
            'Genetics has transformed our understanding of how variation in DNA can influence risk of developing conditions, such as cancer and heart disease. Studies that can combine this genetic information with other blood-based factors â€“ including proteins, metabolites and lipids â€“ and health records, have the potential to provide more direct insight into disease aetiology and prediction. A key challenge so far, however, has been accessing this information at sufficient scale.\n\nThe development of a National Multi-omics Consortium aims to address this challenge by bringing together information on participants from multiple studies to enhance scientific power, breadth, and robustness. The Consortium is one of the major initiatives within HDRUKâ€™s Understanding the Causes of Disease programme, led by HDR UK Researcher Dr Adam Butterworth. It will bring together existing and unique data assets, maximising their value within an open and collaborative national team. \n\nThe Consortium will initially involve nine longitudinal UK population cohorts within the HDR UK network, comprising over 750,000 participants:\n- AIRWAVE Health Monitoring\n- COMPARE Study\n- EPIC-Norfolk\n- The Fenland Study\n- Generation Scotland\n- GoDARTS\n- INTERVAL Study \n- UCLEB Consortium\n- UK Biobank\n\nMore info can be found [here](https://www.hdruk.ac.uk/projects/a-national-multi-omics-consortium-to-inform-disease-aetiology-and-prediction/). This collection will feature datasets, projects and outputs from the HDR UK Multi-omics Consortium.\n',
