        id: 5626663352808625,
        name: 'ORCHID',
        description:
            'ORCHID is the secure data processing environment for the Oxford-Royal College of GPs Clinical Informatics Digital Hub. [orchid.phc.ox.ac.uk](https://orchid.phc.ox.ac.uk). ORCHID operates within the Five Safes Framework. The environment currently does not have break-down costs in terms of specific technical requirements, rather these are encompassed into any costs presented to applicants at the application stage.\n\nActive Users: 100 | Active Projects: 50\n\n---\n\n### SAFE People - Login & Access  \n\nâœ“ Accredited Researcher Status Required â€“ Information governance training, data sharing agreements, research project approval\n\nâœ“ Login: User Registration, VDI over a VPN, Authentication: 2FA\n\nâœ“ Minimum Requirement: No minimum requirement  \n\nâœ“ International Access: International access allowed\n\n---\n\n### SAFE Settings - Compute & Services\n\nâœ“ Private Cloud\n\nâœ“ Virtual desktops (Windows Server 2019 build 1809, or Ubuntu server 20.04 LTS) with 4 vCPU, 16GB RAM and HDD on a project basis\n\nâœ“ Further compute environments including an R Studio service (8vCPUâ€™s 32GB RAM) and a STATA MP16 environment (8vCPUâ€™s, 32GB RAM). Additional requirements can be supported as required although these need to be discussed at the application stage of the project.\n\nâœ“ Users are not able to modify the base VM, however they can request additional software or modules via an approval process.\n\nâœ— Managed Data analytics capabilities: No\n\nâœ— No federated queries\n\nâœ— No federated analytics \n\n---\n\n### SAFE Settings - Security Certifications and Measures\n\nâœ“ Security Certifications: NHS DSPT Toolkit \n\nâœ“ Security Measures: Manual User Provisioning, University of Oxford or ORCHID VPN, Password rotation, managed data provisioning, No external network access, Secure data ingress/egress\n\nâœ“ No VM direct access, Access only through VDI only.\n\nâœ“ No VM access control (no USB, copy/paste disabled, no internet access\n\n---\n\n### SAFE Settings - Software access  \n\nâœ“ Default software: Word, Excel, SQL Server Enterprise Manager, Notepad++, 7Zip, Rstudio, STAT MP8 v16, Tableau, MS SQL Server 2016, Matlab, SAS, MS Visual Studio 2019, C/C++/C#, Python\n\nâœ“ Code/library import: Files can be submitted to the web transfer service. \n\nâœ“ Collaboration Software: Shared File Store, MS Teams\n\n---\n\n### SAFE Data - Data Access Mechanisms\n\nâœ“ Data Provisioning: Researchers are able to import data into data analysis software hosted in a secure environment. Read-only access is granted for specific data tables in the database.\n\nâœ“ Reduce re-identification risk by: Individual training, read-only access control policy, code retention, statistical disclosure control policies\n\nâœ“ Receive Data: Data can be imported into a secure environment through the web transfer service. All files submitted are validated by ORCHID administrators.\n\nâœ“ Linked Data: Identifiable data fields are hashed using a salt outside of the secure environment and then imported through a secure file share by the ORCHID administrator. \n\n- âœ“ Sensitive Data: Sensitive data can be imported into the secure environment by the ORCHID administrator and added to a file share within the secure environment or added as tables to the secure database.\n\n- âœ“ Open Data: Open data can be transferred into the secure environment using the web transfer tool. \n\nâœ— Record Linkage: No record linkage services\n\n---\n\n### SAFE Outputs - Data Output/export  \n\nâœ“ Aggregate level graphs and tables, individual level, anonymised data\n\nâœ“ Other Export plans: No  \n\nâœ“ Data transmit to other SAFE Settings possible via secure web transfer service which can only be accessed through a VPN \n\nâœ“ Statistical Disclosure Control: A member of the ORCHID DBA team manually reviews outputs prior to approving through the web transfer tool.',
