        id: 4984635552758454,
        name: 'Scottish National Safe Haven',
        description:
            'The Scottish National Safe Haven is the responsibility of the electronic Data Research and Innovation Service (eDRIS) which is part of Public Health Scotland. Formally the Scottish NSH is operated by EPCC (part of the University of Edinburgh) under contract to eDRIS in governance terms. In practice, it is very much a collaboration between eDRIS, EPCC and National Records of Scotland (who provide de-identification services).\n\nActive users: 350 open researcher accounts  |  Active projects: 200\n\nPricing: Studies are priced as small, medium or large, and there is an annual fee for compute/disclosure. [Pricing details](https://www.isdscotland.org/Products-and-Services/eDRIS/_docs/2a-eDRIS-pricing-guide.pdf ).\n\n---\n\n### SAFE People - Login & Access  \n\nAll users must become an Approved Researcher. They must all demonstrate appropriate Information Governance training and come from an Approved Organisation. They must also read and sign the eDRIS User Agreement.\n\nâœ“ Login: login to a virtual desktop environment via SSO and 2FA.\n\nâœ— Minimum requirement: users access the Scottish NSH from their desktop using a VPN connection via a whitelisted IP address.\n\nâœ— International access: if approval is given then this is possible but the same controls will apply as for other users. In practice, collaboration with an existing Approved Organisation is the simplest approach rather than from an organisation outside the UK.\n\n---\n\n### SAFE Settings - Compute & Services\n\nâœ“ Private Cloud environment accessed over virtual desktop infrastructure (VDI): a â€œdesktop in a browserâ€.\n\nâœ“ A wide variety of VMs can be provided and these are sized according to the needs of each project. In general a single VM is provided with a small number of cores.  \n\nâœ“ Some servers which have two CPUs and 4 GPUs are also available - again these are provided as VMs to users.\n\nâœ— No managed data analytics provided.\n\nâœ— No federated queries.\n\nâœ— No federated analytics.\n\n---\n\n### SAFE Settings - Security Certifications and Measures\n\nâœ“ Security certifications: governed by eDRIS and approved by NHS Scotland IT Security. ISO27001, ISO9001, Cyber Security Essentials and DEA Accredited Processor\n\nâœ“ Security measures: regular IT Health checks, whitelisting of IP address, VDI, 2FA and NextGen Firewall. Projects are backed up and archived. System and user activity is logged.\n\nâœ“ Secured operating system: users have no ability to modify OS.\n\nâœ“ No VM direct access: access is via VDI only.\n\nâœ“ VM access controls: no USB, no copy/paste, no Internet access, internal mirrors for software packages.  \n\n---\n\n### SAFE Settings - Software access  \n\nâœ“ Default software: R, Stata, SAS, SPSS, MS Office.\n\nâœ“ Code/library import: users may import software code associated with the standard packages above. These code imports use standard managed file transfer mechanisms under eDRIS control, and basic security checks are performed.\n\nâœ“ Collaboration software: in development; not yet available.\n\nâœ— No software installation by users is permitted.\n\n---\n\n### SAFE Data - Data Access Mechanisms\n\nâœ“ Data provisioning: scoped and minimized linked data provided on a per project basis. See the eDRIS [Data Linkage Process](https://www.isdscotland.org/Products-and-Services/eDRIS/_docs/2b-Indexing-and-Linkage-Process-Diagram.pdf) pages.\n\nâœ“ Reduce re-identification risk by separation of concerns â€“ EPCC, eDRIS and National Records of Scotland provide a triple lock on re-identification.\n\nâœ“ Receive data: all data transfer is via managed file transfer (MFT) service [SERV-U](https://www.serv-u.com/) under eDRIS control. All requested datasets are included in initial project applications and are approved for use in combination. No datasets may be added without additional approval. \n\n- âœ“ Linked data: yes, approved datasets only; linkage during project setup via eDRIS.\n\n- âœ“ Sensitive data: yes, approved datasets only; users may not import data.\n\n- âœ“ Open data: yes, approved datasets only; users may not import data.\n\nâœ“ Record linkage: linkage performed using study-specific ID numbers derived from encrypted CHI.\n\n---\n\n### SAFE Outputs - Data Output/export  \n\nâœ“ Aggregate level graphs and tables. In general exported data are aggregate results for inclusion in papers etc. However, since all data egress is subject to disclosure control by eDRIS, a request to eDRIS to export any data type can be made, provided the export would be allowed by the data controller. In practice this means that what can be exported is limited and tightly controlled.\n\nâœ“ Export plans: none specified.\n\nâœ“ Data transmit to other SAFE Settings: mechanisms are in place for us to transfer data via MFT to external locations, provided such a transfer is within the terms of the IG approvals for a specific project / data set.\n\nâœ“ Statistical disclosure control process in place.\n\n',
