        id: 8207390169730131,
        name: 'NHS DigiTrials: Clinical Trials',
        description:
            'NHS DigiTrials works in partnership to support clinical trialists in their applications for and access to patient data to support research into COVID-19 and beyond. NHS DigiTrials is proud to be supporting the Oxford Recovery Trial and the COVID-19 vaccine trials. \n \nNHS Digital works on the NHS DigiTrials service in collaboration with the University of Oxford Big Data Institute, IBM and Microsoft, and commissioned by Health Data Research UK (HDRUK) through the UK Research and Innovation Industrial Strategy Challenge Fund.\n \nIt is supported by the Association of Medical Research Charities (AMRC), the National Institute of Health Research Clinical Research Network (NIHR), and the Health Research Agency (HRA), who are members of the governance board.\n\nNHS DigiTrials also works closely with patients and public who are members of its co-development panel and they are a key part of the service design. The panel ensures that the service is trustworthy, accessible and keeps them well informed as to how patient data is being used for trials. \n\nNHS DigiTrialsâ€™s vision is to create and provide a service that provides clear benefits at the right time and in the right way for its customers. Recognising that clinical trials will be focused on COVID-19 for the foreseeable future, it is currently looking at the need for outcome data to support this vital work â€“ namely data about clinical interventions and their results across a range of care settings. \n\nCurrent outcomes supported by NHS DigiTrials have so far included the first set of results on the [success of Dexamethasone in reducing deaths of people on ventilators (part of the Oxford RECOVERY trial)](https://digital.nhs.uk/news-and-events/news/nhs-digital-enables-researchers-to-find-effective-treatment-for-covid-19), [trials with NHS Blood and Transplant into the effectiveness of treating coronavirus patients with plasma from people who have recovered from COVID-19 and vaccine trials](https://digital.nhs.uk/blog/transformation-blog/2020/how-were-supporting-covid-19-convalescent-plasma-trials). \n\nYou can find more information about NHS DigiTrials via the [NHS Digital webpages](https://digital.nhs.uk/services/nhs-digitrials). Content is soon to be updated and refreshed as the â€˜go toâ€™ website for news and views on the DigiTrials programme of activity for both DigiTrials customer and public and patients. ',
