        id: 1500718307312039,
        name: 'COVID-19',
        description:
            'As the national institute for health data science, the Health Data Research UK (HDR UK) community is actively championing the use of health data to address the global COVID-19 challenge. Institute members across our sites and hubs are contributing to this global challenge by forging partnerships with government, NHS, industry and academia. Teams are working on risk factors, genomics, clinical trials, care pathways and surveillance to help, for example, identifying which treatments and which clinical practices have the best outcomes for patients with COVID-19. These activities require access to and linkage of health data and we can build on our existing expertise and emerging capabilities to support this. You can learn more about our COVID-19 work here - https://www.hdruk.ac.uk/covid-19. \n\nThis collection will feature resources and outputs addressing the COVID-19 challenge.\n\n\n\n\n',
